import Layout from "../components/Layout";

const About = () => (
  <Layout>
    <h1>About coinview</h1>
    <p>
      This is my first next.js tryout. <br /> I used coindesk's api to get the
      exchange rates of BTC
    </p>
  </Layout>
);

export default About;
